    data: |
      SELECT DISTINCT + col0 + col2 / + col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( ( NOT col1 + col0 <= col2 + 82 ) );
  - name: tab1

outputs:
  - name: q896.out
    data: |
      57
      92
      96
